from os import remove


class Solution:
    def find_i_pair(self, index, value, pair):
        lookup = {(d.get("value"), d.get("index")) for d in pair if "value" in d and "index" in d and d.get("remove") != True}
        return (value, index) in lookup  # True/False


    def isValid(self, s: str) -> str:
        char_list = s

        starting_list = ['(','[','{']
        tail_list = [')',']','}']

        starting_list_set = set(starting_list)
        tail_list_set = set(tail_list)

        find_pair = []
        i = 0
        j = 0

        removed = [False] * len(char_list)

        if len(s) == 1:
            return False

        while i < len(char_list):
            if removed[i]:
                i += 1
                continue

            if len(find_pair) == len(char_list):
                return False

            while j < len(char_list):
                print(f"j:  {j}")
                if removed[j]:
                    j += 1
                    continue

                if self.find_i_pair(j,char_list[j], find_pair):
                    j = j + 1
                    print(f"skipping: index: {j} and char: {char_list[j]}")
                    continue

                if char_list[j] in starting_list_set:
                    print('inside inserting find_pair')
                    new_dict = { "index": j, "value": char_list[j], "remove": False}
                    find_pair.append(new_dict)
                    print(f"find_pair: {find_pair}")
                    j = j + 1
                    break

                if len(find_pair) > 0:
                    print('inside for finding tail')
                    filtered_find_pair = [d for d in find_pair if not d.get('remove', False)] # only get false value
                    if len(filtered_find_pair) == 0:
                        return False
                    find_pair_last_element = filtered_find_pair[-1]["value"]
                    find_pair_last_element_index = filtered_find_pair[-1]["index"]

                    find_tail_list = tail_list[int(starting_list.index(find_pair_last_element))]

                    if find_tail_list == char_list[j]:
                        filtered_find_pair[-1]["remove"] = True
                        removed[find_pair_last_element_index] = True
                        removed[j] = True

                        j = 0
                        break
                    else:
                        return False

                if char_list[j] in tail_list_set:
                    return False

                j += 1
            i += 1

        if False in removed:
            return False
        else:
            return True

